import React from "react";
import styles from "./ListHeader.module.css";
import { ListItemWrap } from "./ListItemWrap";

export const ListHeader = () => {
  return (
    <li className={styles["item-wrap"]}>
      <div>Full name</div>
      <div>Birtdday</div>
      <div>Gender</div>
      <div>Department</div>
      <div>Salary</div>
    </li>
  );
};
